import './index.css';

function MainPage() {
	return (
		<div>
			<div id="header">
				<div id="header-area">
					<h2><img src="images/mainLogo.png" width="55" height="20"></img>한성마켓</h2>
				</div>
			</div>
			<div id="body">
				<div id="banner">
					<img src="images/bannerImg.png" />
				</div>
			</div>
		</div>
	);
}

export default MainPage;
